import React from 'react';
import { useTheme } from './ThemeContext';
import { Link } from 'react-router-dom';
import { 
  HomeIcon, 
  UserIcon, 
  SettingsIcon, 
  BookOpenIcon, 
  MessageSquareIcon 
} from 'lucide-react';

const HomePage = () => {
  const { isDarkMode } = useTheme();

  // Define menu items with icons and routes
  const menuItems = [
    { 
      icon: HomeIcon, 
      title: "Dashboard", 
      route: "/dashboard",
      description: "Overview of your progress and insights"
    },
    { 
      icon: UserIcon, 
      title: "Profile", 
      route: "/profile",
      description: "Manage your personal information"
    },
    { 
      icon: BookOpenIcon, 
      title: "Courses", 
      route: "/courses",
      description: "Explore available learning paths"
    },
    { 
      icon: MessageSquareIcon, 
      title: "Community", 
      route: "/community",
      description: "Connect with fellow learners"
    },
    { 
      icon: SettingsIcon, 
      title: "Settings", 
      route: "/settings",
      description: "Customize your experience"
    }
  ];

  return (
    <div className={`
      min-h-screen p-6 
      ${isDarkMode 
        ? 'bg-gray-900 text-white' 
        : 'bg-gray-100 text-gray-900'
      } transition-colors duration-300
    `}>
      <div className="container mx-auto max-w-6xl">
        {/* Header */}
        <header className={`
          mb-10 flex justify-between items-center
          ${isDarkMode 
            ? 'border-b border-gray-700' 
            : 'border-b border-gray-200'
          } pb-4
        `}>
          <h1 className={`
            text-3xl font-bold
            ${isDarkMode 
              ? 'text-blue-400' 
              : 'text-blue-600'
            }
          `}>
            Welcome Back, User
          </h1>
        </header>

        {/* Menu Grid */}
        <div className="grid md:grid-cols-3 gap-6">
          {menuItems.map((item, index) => {
            const IconComponent = item.icon;
            return (
              <Link 
                to={item.route} 
                key={index}
                className={`
                  block p-6 rounded-xl shadow-lg transition-all duration-300
                  ${isDarkMode 
                    ? 'bg-gray-800 hover:bg-gray-700 text-white' 
                    : 'bg-white hover:bg-blue-50 text-gray-800'
                  } 
                  transform hover:-translate-y-2 hover:shadow-xl
                `}
              >
                <div className="flex items-center mb-4">
                  <IconComponent 
                    className={`
                      w-10 h-10 mr-4
                      ${isDarkMode 
                        ? 'text-blue-400' 
                        : 'text-blue-600'
                      }
                    `} 
                  />
                  <h2 className="text-xl font-semibold">{item.title}</h2>
                </div>
                <p className={`
                  text-sm
                  ${isDarkMode 
                    ? 'text-gray-400' 
                    : 'text-gray-600'
                  }
                `}>
                  {item.description}
                </p>
              </Link>
            );
          })}
        </div>

        {/* Quick Stats Section */}
        <div className={`
          mt-10 p-6 rounded-xl
          ${isDarkMode 
            ? 'bg-gray-800 text-white' 
            : 'bg-white text-gray-800'
          } shadow-lg
        `}>
          <h3 className={`
            text-2xl font-bold mb-4
            ${isDarkMode 
              ? 'text-blue-400' 
              : 'text-blue-600'
            }
          `}>
            Quick Stats
          </h3>
          <div className="grid md:grid-cols-3 gap-4">
            <div className={`
              p-4 rounded-lg
              ${isDarkMode 
                ? 'bg-gray-700' 
                : 'bg-blue-50'
              }
            `}>
              <h4 className="text-lg font-semibold">Courses Completed</h4>
              <p className="text-3xl font-bold">12</p>
            </div>
            <div className={`
              p-4 rounded-lg
              ${isDarkMode 
                ? 'bg-gray-700' 
                : 'bg-blue-50'
              }
            `}>
              <h4 className="text-lg font-semibold">Total Learning Hours</h4>
              <p className="text-3xl font-bold">124</p>
            </div>
            <div className={`
              p-4 rounded-lg
              ${isDarkMode 
                ? 'bg-gray-700' 
                : 'bg-blue-50'
              }
            `}>
              <h4 className="text-lg font-semibold">Current Streak</h4>
              <p className="text-3xl font-bold">45 Days</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
